import { Layout } from 'antd';
import './HouseDesc.css'

function HouseDesc() {
    const { Sider, Content } = Layout;

    return (
        <div className="HouseDescArea">
            <Layout className="">
                <Sider width="30%" className="WhiteArea">
                    <img src="https://i.pinimg.com/originals/cc/50/63/cc506354d3bd16a508b013e1bc037a96.jpg" alt="" />
                </Sider>
                <Content className="WhiteArea">
                    <p>右欄</p>
                </Content>
            </Layout>
        </div>
    );
}

export default HouseDesc;
